-- For deleting the existing database and to recreate it everytime we run the scripts
DROP DATABASE IF EXISTS USERS;

-- For creating and using the database called FLIPCART
CREATE DATABASE USERS;
USE USERS;

-- For deleting the existing tables and to have no conflicts of foreign keys while deleting tables
SET FOREIGN_KEY_CHECKSsys_config=0;
DROP TABLE IF EXISTS CUSTOMERS;
DROP TABLE IF EXISTS ADMINS;
DROP TABLE IF EXISTS USER_PREFERANCE;
SET FOREIGN_KEY_CHECKS=1;


-- Table creation of each entity --
CREATE TABLE Customers(
customer_id int(10) PRIMARY KEY,
customer_username varchar(50) Not null,
customer_password varchar(50) not null,
customer_number varchar(10) UNIQUE,
customer_email_ID varchar(50) UNIQUE,
customer_city varchar(40) NOT NULL,
customer_country varchar(20) NOT NULL
);

CREATE TABLE Admins(
admin_id int(10) PRIMARY KEY,
admin_username varchar(50) UNIQUE NOT NULL,
admin_password varchar(50) unique not null,
admin_phone_number varchar(20) UNIQUE NOT NULL,
admin_email_id varchar(50) UNIQUE
);

CREATE TABLE User_Preferance(
user_id int(10) PRIMARY KEY,
prefered_type varchar(50) UNIQUE NOT NULL,
prefered_specific varchar(50) UNIQUE NOT NULL,
prefered_country varchar(50) UNIQUE NOT NULL
);

